.text

.global main
main:
movia r6, BLACK
 init_vga:

        /* We call a function!  Therefore, we can't rely on values not
	changing! */
        subi sp, sp, STACK_SIZE
        stw r16, 0(sp)
        stw r17, 4(sp)
        stw r18, 8(sp)
        stw r19, 12(sp)
        stw r20, 16(sp)
        stw ra, 20(sp)
  
  addi r16, r0, 0
  addi r17, r0, 0
  addi r18, r0, 0

        /* i < 160 */
          addi r19, r0, MAX_X
        /* j < 120 */
        addi r20, r0, MAX_Y
 loop:

        mov r4, r16
        mov r5, r17
        
  call put_pixel
        /* i++ */
  addi r16, r16, 1 
  addi r12, r12, 4  
  blt r16, r19, loop

        /* i = 0 */
  movi r16, 0
        /* j++ */
  addi r17, r17, 1
  blt r17, r20, loop
  
  end:
        ldw r16, 0(sp)
        ldw r17, 4(sp)
        ldw r18, 8(sp)
        ldw r19, 12(sp)
        ldw r20, 16(sp)
        ldw ra, 20(sp)
        addi sp, sp, STACK_SIZE

        




movia r11, arr
movia r3,0
movia r2,ADDR_VGA
		
		
		
		
       
	display_loop:
		ldw r10, 0(r11)
		
        stwio r10,0(r2)
		addi r11, r11, 4 
		addi r2, r2, 4 
		
		addi r3,r3,1
		movi r10, 19200
		bne r3, r10, display_loop	
		
		
				
		
		

       